        super(props)

        const user = localStorage.getItem('user')

        console.log('email:'+user.email)

        this.state = {
            name: '',
            email: '',

        }

        this.setState({
            name:user.name,
            email: user.email
        })

    }


    render(){
        return(
    <Fragment>
        <Aside userNome={this.state.name} userEmail={this.state.email}/>
        <Competences/>
    </Fragment>
        )
    }
}

export default Profile
